import { Link } from "react-router-dom";

export const EventsPage = () => {
  const DUMMY_EVENTS = [
    {
      id: "e1",
      title: "Some Event",
    },
    {
      id: "e2",
      title: "Another Event",
    },
  ];
  return (
    <>
      <h1>Events page</h1>
      <ul>
        {DUMMY_EVENTS.map((event) => (
          <li>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};
